import Title from "./Title";
import Image from "./Image";
import About from "./About";
import Homepage from "./Homepage";
import "./App.css";

import {Route, Link, BrowserRouter as Router } from 'react-router-dom';

class App extends Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <Router>
      <div className="App">
        <Homepage />
      </div>
      </Router>

    );
  }
}

export default App;
